import React, {useState, useEffect} from 'react';
import axios from 'axios';

const Header = () => {
  let [ workOrder, setWorkOrder ] = useState([]);

  useEffect(()=> {
    const results = axios.get(`https://www.hatchways.io/api/assessment/work_orders`)
    .then(response => {
      setWorkOrder(response.data.orders)
      // console.log(response.data.orders)
    })
  }, [])

  return(
    <div>
      <input />
      spring switch newest / latest

    </div>
  )
}

export default Header;
